import React from 'react'

export default function TopButtons() {
    const cities=[
        {
            id:1,
            city:'London'
        },
        {
            id:2,
            city:'Sydney'
        },
        {
            id:3,
            city:'Tokyo'
        },
        {
            id:4,
            city:'Toronto'
        },
        {
            id:5,
            city:'Paris'
        }
    ]

  return (
    <div className='flex items-center justify-center my-6'>
        {cities.map((city)=>(
            <button className='e'>{city.title}</button>
        )

        )}
    </div>
  )
}
